import React, {createContext} from 'react';
import {useCart} from "./CartContext";

function Cart() {
    const { cartItems } = useCart();

    if(document.URL.endsWith('/cart')) {
        return (
            <div>
                <h1>Cart</h1>
                <ul>
                    {cartItems.map((item, index) => (
                        <li key={index}> {item.name} </li>
                    ))}
                </ul>
            </div>
        );
    } else {
        return ("");
    }
}

export default Cart;
